@Override
public Path getPath(URI uri) {
  if (fileSystem == null) {
    throw new IllegalStateException("subclass did not initialize singleton filesystem");
  }
  Path path = delegate.getPath(toDelegate(uri));
  return new FilterPath(path, fileSystem);
}

